import React, { Component } from 'react';
import StockRow from './StockRow.js'


class StockList extends Component {

    constructor(props) {
        super(props)
        this.state = {
            lastTradingDate: null
        }
    }


    render() {
        const lastTradingDate = this.state.lastTradingDate;
        return (
            <ul className="list-group list-group-flush">
              <StockRow name="Apple" ticker="aapl" lastTradingDate={this.state.lastTradingDate} />
              <StockRow name="Google" ticker="goog" lastTradingDate={this.state.lastTradingDate} />
              <StockRow name="Microsoft" ticker="msft" lastTradingDate={this.state.lastTradingDate} />
              <StockRow name="GE" ticker="ge" lastTradingDate={this.state.lastTradingDate} />
            </ul>
        )
    }

}

export default StockList;
